            double finalX = originX + lineSeg.end.x;
            double finalY = originY - lineSeg.end.y;

            int fromX = (int) initX;
            int fromY = (int) initY;

            boolean abort = false;
            long elapsedTime = System.currentTimeMillis() - initialTime;

            while (!abort && elapsedTime + MILLIS_PER_FRAME < drawTime) {
                // while we have time remaining for this action
                double fractionDone = Math.max(elapsedTime * 1.0 / drawTime, 0);
                int toX = (int) Math.round(initX * (1 - fractionDone) + finalX * fractionDone);
                int toY = (int) Math.round(initY * (1 - fractionDone) + finalY * fractionDone);
                graphics.drawLine(fromX, fromY, toX, toY);
                drawLabel.repaint();

                try {
                    Thread.sleep(MILLIS_PER_FRAME);
                } catch (InterruptedException e) {
                    abort = true;
                }

                // update
                fromX = toX;
                fromY = toY;

                elapsedTime = System.currentTimeMillis() - initialTime;
            }

            // finish the line if we're still not done
            if (!abort && (fromX != finalX || fromY != finalY)) {
                graphics.drawLine(fromX, fromY, (int) finalX, (int) finalY);
                drawLabel.repaint();
            }
        }
    }
}

package turtle;

import java.lang.Math;
import java.util.List;
import java.util.ArrayList;

public class TurtleSoup {

    /**
     * Draw a square.
     * 
     * @param turtle the turtle context
     * @param sideLength length of each side
     */
    public static void drawSquare(Turtle turtle, int sideLength) {
        //throw new RuntimeException();
        turtle.forward(sideLength);
        turtle.turn(90.0);
        turtle.forward(sideLength);
        turtle.turn(90.0);
        turtle.forward(sideLength);
        turtle.turn(90.0);
        turtle.forward(sideLength);
        turtle.turn(90.0);    //finish pointing up, like at start

    }

    /**
     * Determine inside angles of a regular polygon.
     * 
     * There is a simple formula for calculating the inside angles of a polygon;
     * you should derive it and use it here.
     * 
     * @param sides number of sides, must be >2
     * @return angle, in degrees
     */
    public static double calculateRegularPolygonAngle(int sides) {
        //throw new RuntimeException();
        if (sides < 3){
            System.out.println("Bad input"); 
            return 0.00;
        }
        return (180.0 + ((double) sides-3.0)*180.0)/((double) sides);
    }

    /**
     * Determine number of sides given the interior angles of a regular polygon.
     * 
     * There is a simple formula for this; you should derive it and use it here.
     * Make sure you *properly round* the answer before you return it (see java.lang.Math).
     * HINT: it is easier if you think about the exterior angles.
     * 
     * @param angle interior angles, in degrees
     * @return the integer number of sides
     */
    public static int calculatePolygonSidesFromAngle(double angle) {
        //throw new RuntimeException();
        double answer = (360.0/(180.0-angle));
        return (int) java.lang.Math.round(answer);
    }

    /**
     * Given the number of sides, draw a regular polygon.
     * 
     * (0,0) is the lower-left corner of the polygon; use only right-hand turns to draw.
     * 
     * @param turtle the turtle context
     * @param sides number of sides of the polygon to draw
     * @param sideLength length of each side
     */
    public static void drawRegularPolygon(Turtle turtle, int sides, int sideLength) {
        //throw new RuntimeException();
        double angle = TurtleSoup.calculateRegularPolygonAngle(sides);
        turtle.turn(90-angle);
        for (int i = 0; i < sides-1; i++){
            turtle.forward(sideLength);
            turtle.turn(180-angle);
        }
        turtle.forward(sideLength);
        turtle.turn(90);

    }

    /**
     * Given the current direction, current location, and a target location, calculate the heading
     * towards the target point.
     * 
     * The return value is the angle input to turn() that would point the turtle in the direction of
     * the target point (targetX,targetY), given that the turtle is already at the point
     * (currentX,currentY) and is facing the angle currentHeading. The return angle must be expressed in
     * degrees, and 0 <= angle < 360.
     *
     * HINT: look at http://en.wikipedia.org/wiki/Atan2 and Java's math libraries
     * 
     * @param currentHeading current direction as clockwise from north
     * @param currentX currentY current location
     * @param targetX targetY target point
     * @return adjustment to heading (right turn amount) to get to target point.
     *         Must be positive, and less than 360.
     */
    public static double calculateHeadingToPoint(double currentHeading, int currentX, int currentY,
                                                 int targetX, int targetY) {
        //throw new RuntimeException();
        double angle = java.lang.Math.atan2((targetY-currentY), (targetX-currentX));
        System.out.println("angle: " + angle * 180.0/Math.PI); 
        double newHeading = 90-currentHeading-angle*180.0/Math.PI;
        if(newHeading < 0){
            newHeading = 360+newHeading;
        }
        return newHeading;
    }

    /**
     * Given a sequence of points, calculate the heading adjustments needed to get from each point to the next.
     * 
     * You should use your calculateHeadingToPoint() function in this one to simplify things. Assume
     * that the turtle is at the first point, facing up (i.e. 0 degrees), and for further points,
     * assume that the turtle is facing the direction last specified.  
     * 
     * @param xCoords list of x-coordinates (must be same length as yCoords)
     * @param yCoords list of y-coordinates (must be same length as xCoords)
     * @return list of heading adjustments between points, of size #points-1.
     */
    public static List<Double> calculateHeadings(List<Integer> xCoords, List<Integer> yCoords) {
        //throw new RuntimeException();
        double heading = 0.0;
        List<Double> out = new ArrayList<Double>();
        for(int i = 0; i < xCoords.size()-1; i++){
            double result = TurtleSoup.calculateHeadingToPoint(heading, xCoords.get(i), yCoords.get(i), xCoords.get(i+1), yCoords.get(i+1));
            out.add(result);
            heading = result;
        }
        return out;
    }

    /**
     * Draw your personal, custom art.
     * 
     * Many interesting images can be drawn using the simple implementation of a turtle.  For this
     * function, draw something interesting; the complexity can be as little or as much as you want.
     * We'll be peer-voting on the different images, and the highest-rated one will win a prize:
     * free dinner with select staff members.
     * 
     * @param turtle the turtle context
     */
    public static void drawPersonalArt(Turtle turtle) {
        //throw new RuntimeException();
        drawRegularPolygon(turtle, 4, 70);
        turtle.forward(20);
        drawRegularPolygon(turtle, 5, 70);
        turtle.forward(20);
        drawRegularPolygon(turtle, 6, 70);
        turtle.forward(20);
        drawRegularPolygon(turtle, 7, 70);
        turtle.forward(20);
        drawRegularPolygon(turtle, 8, 70);
        turtle.forward(20);
        drawRegularPolygon(turtle, 9, 70);
        turtle.forward(20);
        drawRegularPolygon(turtle, 10, 70);
    }

    /**
     * Optional Challenge Problem: Draw a Sierpinski triangle.
     * 
     * A Sierpinski triangle is a fractal structure that can be approximated by recursively drawing
     * triangles, among other methods.  The fractal itself would require infinite recursion to draw;
     * this function only draws to a certain depth.
     *
     * See the handout for a description of what this function should do.
     * 
     * @param turtle the turtle context
     * @param depth the depth to draw the triangle
     */
    public static void drawSierpinksiTriangle(Turtle turtle, int depth) {
        //throw new RuntimeException();
        //if(depth ==0){
            drawRegularPolygon(turtle,3,4*((int) Math.pow(2.0, (double) depth+1.0)));
        //}
        if(depth > 0){
            drawRegularPolygon(turtle,3,4*((int) Math.pow(2.0, (double) depth)));
            drawSierpinksiTriangle(turtle, depth-1);
            double angle = TurtleSoup.calculateRegularPolygonAngle(3);
            turtle.turn(90-angle);

            turtle.forward(4*((int) Math.pow(2.0, (double) depth)));
            turtle.turn(-30);
            drawRegularPolygon(turtle,3,4*((int) Math.pow(2.0, (double) depth)));
            drawSierpinksiTriangle(turtle, depth-1);
            turtle.turn(30);
            turtle.turn(180-angle);

            turtle.forward(4*((int) Math.pow(2.0, (double) depth)));
            turtle.turn(-150);
            drawRegularPolygon(turtle,3,4*((int) Math.pow(2.0, (double) depth)));
            drawSierpinksiTriangle(turtle, depth-1);
            turtle.turn(150);
            turtle.turn(180-angle);

            turtle.forward(4*((int) Math.pow(2.0, (double) depth)));
            turtle.turn(90);
        }
    }

    /**
     * Main method
     * 
     * This is the method that runs when you run "java TurtleSoup".  Right now, it
     * will run your drawSquare() method.
     */
    public static void main(String args[]) {
        DrawableTurtle turtle = new DrawableTurtle();
        //drawRegularPolygon(turtle, 3, 70);
        /*
        turtle.turn(180);
        turtle.forward(100);
